import React from "react";

const About = () => {
  return (
    <div id="about">
      <h2>About</h2>
      <img
        src="https://3.bp.blogspot.com/-ZL7fCrVhP0U/W-mww8IGnTI/AAAAAAAANAg/A8LwYP9AC5QTo4I37Y8ke4ggJJDlauZ7gCLcBGAs/s1600/nyala.jpg"
        alt="Nyala"
      />
      <ul>
        <li>
          I design, create, and manage quick and responsive web applications
          with user experience in mind. When I'm not coding or learning a new
          technology, I enjoy rock climbing and studying history.
        </li>
        <li>Some Technologies I Enjoy Using:</li>
          <ul>
            <li>HTML5, JSX</li>
            <li>CSS3 (Flexbox & Grid), SASS, Bootstrap, SemanticUI  </li>
          </ul>
      </ul>
    </div>
  );
};

export default About;
